Mongoose - get documents with best score but only one of each user<p>So this is how my mongoose schema looks like:</p>
<pre><code>const QuizModel = new mongoose.Schema({ 
  quizId: { type: String, required: true, trim: true },  
  userId: { type: String, required: true, trim: true },  
  result: { 
    score: { type: Number, required: true},
    time: { type: Number, required: true },   
  }, 
});
</code></pre>
<p>This is a quiz application so there are multiple documents with same <code>userId</code>.
I am trying to make a query to build leaderboard and I came up with this.</p>
<pre><code>const topUsers = await QuizModel.find({})
      .sort({ &quot;result.score&quot;: &quot;desc&quot;, &quot;result.time&quot;: &quot;asc&quot; })
      .limit(10);
</code></pre>
<p>Now because I want to show only top 10 users, I have added <code>.limit(10)</code>.
Now in these 10 documents, there is chance that all the 10 docs are of same user i.e. same <code>userId</code>.</p>
<p>How do I prevent this and still get 10 documents with all unique <code>userId</code>?
I don't want a single user to occupy all 10 slots in leaderboard.</p>
<p><strong>Example:</strong>
<strong>User1</strong> has 5 docs with above schema with scores 100, 95, 92, 90, 60
<strong>User2</strong> has 5 docs with above schema with scores 95, 92, 90, 80, 60</p>
<p>Expected Output is:</p>
<pre><code>[
  {
    quizId: &quot;....&quot;, 
    userId: &quot;user1&quot;,
    result: {
      score: 100,
      time: &quot;some_time&quot;
    }
  },
  {
    quizId: &quot;....&quot;, 
    userId: &quot;user2&quot;,
    result: {
      score: 95,
      time: &quot;some_time&quot;
    }
  }
]
</code></pre>

