How do I save an image on disk and the images path on mongodb with multer?<p>So far I managed to make an image to be uploaded on mongo, but I cant make it to get saved on disk.</p>
<p><strong>React component</strong></p>
<pre><code>const handleUploadPhoto = evt =&gt; {
    evt.preventDefault();

    const uploads = photos.map(async photo =&gt; {
        const formData = new FormData();
        formData.append('photo', photo);

        await axios.post(
            `${baseUrl}/api/photo/upload/${JSON.parse(localStorage.getItem('loggedUser'))._id}`,
            formData,
            { headers: {
                'Content-Type': 'multipart/form-data'
            }},
        );
    });
};
</code></pre>
<p><strong>Upload route with multer setup</strong>:</p>
<pre><code>const FILE_PATH = 'uploads';

const storage = multer.diskStorage({
    destination: (req, file, cb) =&gt; cb(null, FILE_PATH),
    filename: (req, file, cb) =&gt; {
